import { TouchableOpacity, Text, SafeAreaView, View } from 'react-native';
function Input(props) {
    return (
        <View style={{
            height: 50,
            borderRadius: 25,
            backgroundColor: 'red',
            margin: 20,
        
        }}>
            <Text style= {{
                fontWeight: 'bold',
                fontSize: 30,
            }}>
                hi
            </Text>
        </View>
    );
}

export default Input;
